import { Routes, Route } from 'react-router-dom'
import Home from './components/Home';
import Ecommerce from './pages/EcommerceWebsite/components/Ecommerce';
import Page from './pages/EcommerceWebsite/components/Page';
import Products from './pages/EcommerceWebsite/components/Products';
// import CheckOuts from './pages/EcommerceWebsite/components/CheckOuts';  
import Search from './pages/EcommerceWebsite/components/Search';
import { CartContextProvider } from './pages/EcommerceWebsite/context/CartContext'; 
import { SearchContextProvider } from './pages/EcommerceWebsite/context/SearchContext';
import HomeTwice from './pages/Twice/components/HomeTwice';
import Profile from './pages/Twice/components/Profile';
import Discography from './pages/Twice/components/Discography';
import Gallery from './pages/Twice/components/Gallery';
import Video from './pages/Twice/components/Video';
import { Provider } from 'react-redux'
import store from './pages/Javascript Calculator/redux/store';
import Bookkeep from './pages/Bookkeeping/component/Bookkeep';
import { RecordsContextProvider } from './pages/Bookkeeping/context/RecordsContext';
import NotFound from './components/NotFound';
import './App.css'

function App() {
  return (
      <SearchContextProvider>
      <CartContextProvider>
      <RecordsContextProvider>
      <Provider store={store}>
      <Routes>
        <Route path='/' element={<Home />}></Route>
        {/*  ecommerce website  */}
        <Route path='ecommerce' element={<Ecommerce />}></Route>
        <Route path='ecommerce/collections' element={<Page />}>
          <Route path='new-arrivals' element={<Products />}></Route>
          <Route path='home-bath' element={<Products />}></Route>
          <Route path='kitchen-dinning' element={<Products />}></Route>
          <Route path='office-craft' element={<Products />}></Route>
          <Route path='personal-goods' element={<Products />}></Route>
        </Route>
        <Route path='ecommerce/search' element={<Search /> }></Route>
        {/*  twice fans page  */}
        <Route path='twice' element={<HomeTwice />}></Route>
        <Route path='twice/profile' element={<Profile />}></Route>
        <Route path='twice/discography' element={<Discography />}></Route>
        <Route path='twice/gallery' element={<Gallery />}></Route>
        <Route path='twice/video' element={<Video />}></Route>
        {/*  js calculator  */}
        <Route path='bookkeep/*' element={<Bookkeep/>}></Route>
        {/* 404 not found */}
        <Route path='*' element={<NotFound />}></Route>
      </Routes>
      </Provider>
      </RecordsContextProvider>
      </CartContextProvider>
      </SearchContextProvider>
  );
}

export default App;
